import React, { Component } from "react";
import SearchBar from "../components/SearchBar";
import SearchResults from "../components/SearchResults";
import SearchResultsTest from "../components/SearchResultsTest";
import NavBar from "../components/Navbar";
import DatatablePage from "../components/DatatablePage";
import LoginForm from "../components/LoginForm";
import { thunkFetchLeads, thunkFetchLists } from "../actions";
import { connect } from "react-redux";
import BootstrapTable from 'react-bootstrap-table-next';
import paginationFactory from 'react-bootstrap-table2-paginator';
import 'react-bootstrap-table2-paginator/dist/react-bootstrap-table2-paginator.min.css';



const columns = [{
  dataField: 'id',
  text: 'Product ID'
}, {
  dataField: 'name',
  text: 'Product Name'
}, {
  dataField: 'price',
  text: 'Product Price'
}];


const products = [{
  dataField: 'id',
  text: "1"
}, {
  dataField: 'name',
  text: "2"
}, {
  dataField: 'price',
  text: "price"
}]

const CATEGORY_URL = "http://localhost:3000/api/v1/categories";
const LEADS_URL = "http://localhost:3000/api/v1/leads";

class SearchContainer extends Component {

  render() {
    // console.log(this.state)
    return (
      <div>
        <NavBar />
          <div>
            <SearchBar />
            <BootstrapTable keyField='id' data={ products } columns={ columns } pagination={ paginationFactory() } />
            {/* <SearchResultsTest /> */}
          </div>
        {/* <SearchResultsTest />} */}
      </div>
    );
  }
}

// const mapStateToProps = state => {
//   return {leads: state.leads}
// }

const mapDispatchToProps = dispatch => {
  return {
    thunkFetchLeads: () => {
      dispatch(thunkFetchLeads());
    },
    thunkFetchLists: () => {
      dispatch(thunkFetchLists());
    }
  };
};

const mapStateToProps = state => {
  return {
    auth: state.auth
  };
};

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(SearchContainer);
